import React from 'react';

export default function Ajuda({msg, img}) {
    return (
        <div>
            <img src={img} alt="" className="Ajuda-img"/>
            <div className="Ajuda-msg" >
                <div></div>
                <span>{msg}</span>
            </div>
        </div>
    );
}
